import React from "react";

const App = ({notes}) => {

  const handleClick = () => {
    const newNote = notes.map(note => <li>{note.content}</li>);
  }

  return(
    <div>
      <ul>
        {newNote}
      </ul>
      <button onClick={handleClick}>click</button>
    </div>
  )
}
export default App;
